import React from "react";
import styled from "styled-components";
import { Container } from "react-bootstrap";
import { BiMailSend } from "react-icons/bi";
import { GiWideArrowDunk } from "react-icons/gi";
import { GiConfirmed } from "react-icons/gi";
import { MdDateRange } from "react-icons/md";
import { BsInfoCircle } from "react-icons/bs";
import { IoIosDoneAll } from "react-icons/io";


const Styles = styled.div`
  background-color: #fff;
  .vertical-process .row {
    justify-content: center;
  }

  .box {
    box-shadow: 0 2px 5px 0 rgba(0, 0, 0, 0.13);
    width: 100%;
    height: auto;
    background-color: #fff;
    margin: 20px 0;
    border-radius: 8px;
  }

  .box.left {
    text-align: right;
  }

  .box.right {
    text-align: left;
  }

  .box.left .icon,
  .box.right .icon {
    color: #aed6dc;
    text-align: center;
    margin-bottom: 10px;
  }

  .box.left .icon svg,
  .box.right .icon svg {
    width: 40px;
    height: 40px;
  }

  .arrow svg {
    width: 60px;
    height: 60px;
    transform: rotateZ(90deg);
    color: #132968;
  }

  .left .arrow {
    transform: rotate(90deg);
    transform: scaleX(-1);
  }
`;
export const About = () => (
  <Styles>
    <div className="vertical-process">
      <Container>
        <h4 className="title">Hakkımızda</h4>
        <div className="row">
          <div className="col-5 box left">
            <div className="icon">
              <BiMailSend />
            </div>
            <div className="description">
              'Rezervasyon Yap' seçeneğiyle sistemimiz üzerinden 7/24 veya
              rezervasyon@deniztaksi.com adresine mail göndererek rezarvasyon
              yaptırabilirsiniz.
            </div>
          </div>
          <div className="col-5 right">
            <div className="arrow">
              <GiWideArrowDunk />
            </div>
          </div>
        </div>
        <div className="row">
          <div className="col-5 left">
            <div className="arrow">
              <GiWideArrowDunk />
            </div>
          </div>
          <div className="col-5 box right">
            <div className="icon">
              <MdDateRange />
            </div>
            <div className="description">
              Anlık ya da İleri tarihli Deniz Taksi talebinde bulunabilirsiniz.
            </div>
          </div>
        </div>
        <div className="row">
          <div className="col-5 box left">
            <div className="icon">
              <BsInfoCircle />
            </div>
            <div className="description">
            Rezervasyon işleminin tamamlanabilmesi için istenen saat, tarih,
              kalkış iskelesi ve yolcu iletişim bilgilerini eksiksiz
              girdiğinizden emin olun.
            </div>
          </div>
          <div className="col-5 right">
            <div className="arrow">
              <GiWideArrowDunk />
            </div>
          </div>
        </div>
        <div className="row">
          <div className="col-5 left">
            <div className="arrow">
              <GiWideArrowDunk />
            </div>
          </div>
          <div className="col-5 box right">
            <div className="icon">
              <GiConfirmed />
            </div>
            <div className="description">
            Rezervasyon işleminin tamamlanmasının hemen ardından onay mesajı
              kullanıcılara mail yolu ile iletilmektedir.
            </div>
          </div>
        </div>
        <div className="row">
          <div className="col-5 box left">
            <div className="icon">
              <IoIosDoneAll />
            </div>
            <div className="description">
              Rezarvasyon tamamlandı.
            </div>
          </div>
          <div className="col-5 right">
            <div className="arrow">
              <GiWideArrowDunk />
            </div>
          </div>
        </div>
      </Container>
    </div>
  </Styles>
);
